message:
I probably would have just made this:

 elif key in ('ignore_hosts',):

so that it was minimally changed and setup for the future, but that's just a nit.

As an aside, and assuming you'd doing further untangling of this nest, bringing this down a level (in a future patch) would make this easier to read:

  if virt_type == 'parallels':
      pass
  elif virt_type not in ("qemu", "kvm"):
      self._create_consoles_non_qemu_kvm(...)
  else:
      if self._is_s390x_guest(image_meta):
          self._create_consoles_s390x(guest_cfg, instance,
                                      flavor, image_meta)
      else:
          self._create_consoles_qemu_kvm(guest_cfg, instance,
                                         flavor, image_meta)

But maybe that's just me

OK I see you copied this - can we pull this out into a private helper method, something like:

def _get_image_meta_obj(image_meta_dict)
   ....

OK I guess you're checking this because the compute API unshelve method allows unshelving for both shelved and shelved_offloaded:

    @check_instance_state(vm_state=[vm_states.SHELVED,
        vm_states.SHELVED_OFFLOADED])
    def unshelve(self, context, instance):

And in the case of shelved (not offloaded) the port resource requests still apply to the host on which the instance 'lives'. That's potentially racy if the nova-compute service automatically offloads the server while we're doing this check (the _poll_shelved_instances periodic task), but that task should also be setting the task_state so the API would reject the unshelve while the periodic task is running (I'm sure we could still miss that window but it's always existed so nothing new to worry about here).

This is pretty confusing to read. Unless parent='' has special meaning, I think it would be the same to say:

 if parent is None or mdev['parent'] == parent:

It's also more efficient :P

This could be safer as:

 if rp_name.startswith(root.name + '_'):

Unless we can predict how many underscores are in the root.name or parent_device portions of the rp name (or otherwise ensure a deterministic format), in which case we could split() it and get it perfect.

style nit:

  if not self.allocations.pop(instance['uuid'], None):
